import { Button, Container } from "../../Components/commenTags/style"
import {Main} from "./style"
const HomePage=()=>{
    return(
<Main display="flex">

<Button float="right" >CAPAVILITIES</Button>
<Button float="right">WORK</Button>
<Button float="right">BLOG</Button>
<Button float="right">CONTACT</Button>

</Main>
)
}
export default HomePage
